import { useState } from "react";
import { Card, Form, Row, Col, Alert } from "react-bootstrap";

//component
import ToggleButton from "../../components/ToggleButton/index";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
    faSearch,
    faPrint,
    faList,
    faSave,
    faDownload,
    faChevronLeft,
    faPlus,
    faCog,
    faTrash,
    faListAlt
} from "@fortawesome/free-solid-svg-icons";
import { faWhatsapp } from "@fortawesome/free-brands-svg-icons"
import Button from "../../components/Button/index";
import  DashboardCard from "../../components/DashboardCard/index";

//scss
import "./index.scss";

export default function InwardPayment() {

    const receiptDetails = [
        {
            receiptNo: 1,
            companyName: "Product",
            date: "06-Feb-2020",
            paymentType: "Cash",
            paymentNote: "",
            amount: 200.0,
            advancePay: 0.00
        },
        {
            receiptNo: 2,
            companyName: "Product prod",
            date: "06-Dec-2020",
            paymentType: "Cash",
            paymentNote: "",
            amount: 200.0,
            advancePay: 0.00
        }
    ];

    return (
        <div className="screen-stocks">
            <Alert key="infoAlert" variant="info">
                <div className="d-flex justify-content-between">
                <div>Update Contact Phone! Please update your contact phone number</div>
                <Button
                            name="Update Phone"
                            havingIcon={false}
                            buttonType="btn btn-info"
                        />
                </div>
  </Alert>

            <Row>
                <Col>
                    <DashboardCard />
                </Col>
            </Row>
        </div>
    );
}
